function add(a, b) {
    let sum = a + b;
    return sum;
}
function sub(a, b) {
    let subtract = a - b;
    return subtract;
}
function mult(c, d) {
    let multipication = c * d;
    return multipication;
}
function div(c, d) {
    let divide = c / d;
    divide = divide.toFixed(2);
    return divide;
}

export {add , sub, mult, div };
